import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Injectable({
	  providedIn: 'root'
})
export class WishlistService {
  constructor(private http: HttpClient) { }

  getWishlistItems() {
    return this.http.get('http://localhost:5000/wishlist');
  }
}
